customScript.value:
/**
 * Case-insensitive MOBILE check
 */
const isMobileType = (v) =>
  typeof v === "string" && v.trim().toUpperCase() === "MOBILE";

/**
 * Validate and normalize http/https URLs (absolute or relative)
 */
const normalizeHttpUrl = (raw) => {
  if (typeof raw !== "string" || !raw) return null;
  try {
    const u = new URL(raw, window.location.href);
    return (u.protocol === "http:" || u.protocol === "https:") ? u.href : null;
  } catch {
    return null;
  }
};

/**
 * Try to open a URL in a new tab. Returns true if it appears to succeed.
 * Note: Most browsers require a user gesture for this.
 */
const openInNewTab = (href) => {
  const win = window.open(href, "_blank", "noopener,noreferrer");
  if (win) {
    try { win.opener = null; } catch {}
    return true;
  }
  return false;
};

/**
 * Setup logic: if MOBILE, reveal the fallback button and attempt auto-open.
 * Returns true if auto-open succeeded, false otherwise.
 *
 * @param {"MOBILE"|"DESKTOP"|string} deviceType
 * @param {string} verifyURL
 * @param {string} [buttonId="btnContinue"]
 */
function setupMobileVerifyRedirect(deviceType, verifyURL, buttonId = "btnContinue") {
  if (!isMobileType(deviceType)) return false;

  // Reveal the fallback button for user click if needed
  const btn = document.getElementById(buttonId);
  if (btn) btn.classList.remove("d-none");

  // Try to auto-open in a new tab (may be blocked by the browser)
  const href = normalizeHttpUrl(verifyURL);
  if (!href) {
    console.log("verifyURL is missing or invalid.");
    return false;
  }
  return openInNewTab(href);
}

/**
 * Click action: open in new tab when MOBILE (use as your fallback)
 *
 * @param {"MOBILE"|"DESKTOP"|string} deviceType
 * @param {string} verifyURL
 */
function openVerifyURLIfMobile(deviceType, verifyURL) {
  if (!isMobileType(deviceType)) return false;
  const href = normalizeHttpUrl(verifyURL);
  if (!href) return false;
  return openInNewTab(href);
}

// Auto attempt + reveal button if MOBILE
setupMobileVerifyRedirect("{{local.65suu7e8vf.payload.output.devicePolicy}}", "{{local.bbsqrngib4.payload.output.transaction.webVerificationUrl}}");

document.getElementById("btnContinue")?.addEventListener("click", (e) => {
  // e.preventDefault(); // keep the page from submitting
  openVerifyURLIfMobile("{{local.65suu7e8vf.payload.output.devicePolicy}}", "{{local.bbsqrngib4.payload.output.transaction.webVerificationUrl}}"); // opens in a new tab
});

