/* For Webkit browsers like Chrome, Safari */
input[type="number"]::-webkit-inner-spin-button, 
input[type="number"]::-webkit-outer-spin-button { 
  -webkit-appearance: none;
  margin: 0; 
}

/* For Firefox */
input[type="number"] {
  -moz-appearance: textfield;
}

/* For Internet Explorer 10+ */
input[type="number"]::-ms-clear,
input[type="number"]::-ms-reveal {
  display: none;
}

/* Setting to hidden as countryCodeDisplay will display the selected value */
#countryCode {
  background: none; 
  color: transparent;
} 

/* Adjust top padding as end-user-nano's label overlaps value */
.end-user-nano .form-floating > .form-select {
  padding-top: 19px;
}

/* Used on Windows machines */
option {
  background-color: var(--bs-white); 
  color: rgba(var(--bs-body-color-rgb), 1) !important;
}

