// Supported language: JavaScript
module.exports = async ({ params }) => {
  /**
   * Evaluates a list of biographic match results to determine whether there is a high-confidence match
   * based on core name fields and supporting personal information.
   * 
   * @param {Array} bioArray - An array of biographic match result objects.
   * @returns {boolean} - Returns true if a high-confidence match is found, otherwise false.
   */
  function bioMatch(bioArray) {
    // Ensure input is an array; otherwise return false
    if (!Array.isArray(bioArray)) return false;

    // Iterate through each item in the array
    for (const item of bioArray) {
      // Only consider results from the BABEL_STREET provider
      if (item.provider !== "BABEL_STREET") continue;

      // Access the detailedResults object safely
      const detailed = item.data?.detailedResults;
      if (!detailed || typeof detailed !== "object") continue;

      // Extract individual confidence values for relevant fields
      const nameConfidence = detailed.name?.confidence;
      const givenNameConfidence = detailed.given_name?.confidence;
      const familyNameConfidence = detailed.family_name?.confidence;
      const addressConfidence = detailed.address?.confidence;
      const birthDateConfidence = detailed.birth_date?.confidence;

      // Extract the overall confidence score (not used in logic, just logged)
      const overallConfidence = item.data?.overallConfidenceScore;

      // Determine if core name confidence criteria are satisfied:
      // - Either: given_name and family_name are both HIGH
      // - Or: name is HIGH and given_name is MEDIUM
      const hasCoreNames =
        (givenNameConfidence === "HIGH" && familyNameConfidence === "HIGH") ||
        (nameConfidence === "HIGH" && givenNameConfidence === "MEDIUM");

      // Determine if at least one supporting info field has HIGH confidence
      const hasSupportingInfo =
        addressConfidence === "HIGH" || birthDateConfidence === "HIGH";

      // Return true as soon as a valid match is found
      if (hasCoreNames && hasSupportingInfo) {
        // return;
        return {
          nameConfidence: nameConfidence,
          givenNameConfidence: givenNameConfidence,
          familyNameConfidence: familyNameConfidence,
          addressConfidence: addressConfidence,
          birthDateConfidence: birthDateConfidence,
          overallConfidence: overallConfidence,
        };
      }
    }

    // If no valid match is found in any of the items, return false
    return false;
  }

  return bioMatch(params.bio);

};

