// Write your code here
// Supported language: Javascript 
module.exports = a = async ({ params }) => {
	function generateNameVariants(given, middle, family, nickname, formatted) {
		const givenNames = new Set();
		const normalize = str => str?.trim().toLowerCase();
		const valid = str => !!str?.trim();

		// Add base given and nickname
		if (valid(given)) givenNames.add(normalize(given));
		if (valid(nickname)) givenNames.add(normalize(nickname));

		// Apply middle variants (plain and dotted) to givenNames
		let middleForms = [''];
		if (valid(middle)) {
			middleForms = [middle];
			if (middle.length === 1) {
				middleForms.push(`${middle}.`);
			}
		}

		for (const mid of middleForms) {
			if (valid(given)) givenNames.add(normalize(`${given} ${mid}`));
			if (valid(nickname)) givenNames.add(normalize(`${nickname} ${mid}`));
		}

		// Build names (first + middle + family)
		const names = new Set();
		const baseFirsts = [given, nickname].filter(valid);

		const familyParts = valid(family) ? family.trim().split(/\s+/) : [];
		const familyVariants = [];

		if (familyParts.length === 0) {
			familyVariants.push('');
		} else if (familyParts.length === 1) {
			familyVariants.push(familyParts[0]);
		} else {
			familyVariants.push(familyParts.join(' '));  // e.g., "Wendel Smith"
			familyVariants.push(familyParts.join('-'));  // e.g., "Wendel-Smith"
		}

		for (const first of baseFirsts) {
			for (const mid of middleForms) {
				for (const fam of familyVariants) {
					const parts = [first, mid, fam].filter(valid);
					const full = normalize(parts.join(' '));
					if (!full.includes('_') && (!full.includes('-') || fam.includes('-'))) {
						names.add(full);
					}
				}
			}
		}

		// Include formatted name
		if (valid(formatted)) names.add(normalize(formatted));

		// Return family name variants as well
		const familyNames = familyVariants.map(normalize);

		return {
			givenNames: Array.from(givenNames),
			names: Array.from(names),
			familyNames
		};
	}

	function generateAddressVariants(streetAddress, locality, region, postalCode, countryCode) {
		const normalize = str => str?.trim().toLowerCase();
		const noPunct = str => str?.replace(/[.,]/g, '').replace(/\s+/g, ' ');

		const base = normalize(streetAddress);
		const baseNoPunct = noPunct(base);
		const city = normalize(locality);
		const state = normalize(region);
		const zip = normalize(postalCode);
		const country = normalize(countryCode);

		const lines = new Set();
		const valid = str => !!str?.trim();

		if (valid(base)) lines.add(base);
		if (valid(baseNoPunct)) lines.add(baseNoPunct);

		if (valid(base) && valid(city)) {
			lines.add(`${base} ${city}`);
			lines.add(`${baseNoPunct} ${city}`);
			lines.add(`${base}, ${city}`);
		}

		if (valid(base) && valid(city) && valid(state)) {
			lines.add(`${base} ${city} ${state}`);
			lines.add(`${baseNoPunct} ${city} ${state}`);
			lines.add(`${base}, ${city}, ${state}`);
		}

		if (valid(base) && valid(city) && valid(state) && valid(zip)) {
			lines.add(`${base} ${city} ${state} ${zip}`);
			lines.add(`${baseNoPunct} ${city} ${state} ${zip}`);
			lines.add(`${base}, ${city}, ${state} ${zip}`);
		}

		if (valid(base) && valid(city) && valid(state) && valid(zip) && valid(country)) {
			lines.add(`${base} ${city} ${state} ${zip} ${country}`);
			lines.add(`${baseNoPunct} ${city} ${state} ${zip} ${country}`);
			lines.add(`${base}, ${city}, ${state} ${zip}, ${country}`);
		}

		if (valid(city) && valid(state)) lines.add(`${city}, ${state}`);
		if (valid(city) && valid(state) && valid(zip)) lines.add(`${city}, ${state} ${zip}`);
		if (valid(city) && valid(state) && valid(zip) && valid(country))
			lines.add(`${city}, ${state} ${zip}, ${country}`);

		if (valid(zip)) lines.add(zip);
		if (valid(zip) && valid(country)) lines.add(`${zip} ${country}`);

		return Array.from(lines);
	}


	function buildProfileVariants(given, middle, family, nickname, formatted, streetAddress, locality, region, postalCode, countryCode) {
		const nameParts = generateNameVariants(given, middle, family, nickname, formatted);
		const address = generateAddressVariants(
			streetAddress,
			locality,
			region,
			postalCode,
			countryCode
		);

		return {
			...nameParts,
			address
		};
	}


	return buildProfileVariants(params.giveName, params.middleName, params.familyName, params.nickName, params.formattedName, params.streetAddress, params.locality, params.region, params.postalCode, params.countryCode)
}

