// Main module export  expects a params object containing `verifiedData`
module.exports = a = async ({ params }) => {

	// Helper function to clean and normalize verified identity data
	function verifiedDataCleaner(verifiedData) {
		if (!Array.isArray(verifiedData)) return null;

		// Extract images (including barcodes)
		const images = {};
		verifiedData.forEach(item => {
			const data = item.data || {};
			const mediaType = item.type || 'UNKNOWN';
			let mediaContent = null;
			let format = data.FORMAT || 'UNKNOWN';

			if (data.IMAGE) {
				mediaContent = data.IMAGE;
			} else if (data.PDF417) {
				mediaContent = data.PDF417;
				format = 'PDF417'; // override format for barcode case
			}

			if (mediaContent) {
				images[mediaType] = {
					format,
					image: mediaContent,
					imageId: item.id
				};
			}
		});

		// Try to get ID document for structured identity data
		const documentByType = {};
		const idDoc = verifiedData.find(item =>
			item.type === 'GOVERNMENT_ID' || item.type === 'PASSPORT'
		);

		let userInfo = null;
		let document = null;

		if (idDoc?.data) {
			const data = idDoc.data;
			const type = idDoc.type;

			const capitalize = str => str
				.trim()
				.split(/\s+/)
				.map(s => s.charAt(0).toUpperCase() + s.slice(1).toLowerCase())
				.join(' ');

			const firstNameRaw = data.firstName || '';
			const firstNameParts = firstNameRaw.trim().split(/\s+/);
			const givenRaw = firstNameParts[0] || '';
			const middleRaw = firstNameParts.slice(1).join(' ') || '';
			const familyRaw = data.lastName || '';

			const name = {
				given: capitalize(givenRaw),
				middle: capitalize(middleRaw),
				family: capitalize(familyRaw),
				formatted: `${capitalize(givenRaw)} ${capitalize(familyRaw)}`.trim()
			};

			const address = {
				streetAddress: data.addressStreet
					? [
						data.addressHouseNumber,
						data.addressStreet,
						data.addressUnit
					]
						.filter(Boolean)
						.join(' ')
					: '',
				locality: data.addressCity || '',
				region: data.addressState?.toUpperCase() || '',
				postalCode: data.addressZip || '',
				countryCode: data.issuingCountry || ''
			};

			userInfo = {
				name,
				birthDate: data.birthDate || '',
				address
			};

			documentByType[type] = {
				idType: data.idType || '',
				idNumber: data.idNumber || '',
				issueDate: data.issueDate || '',
				expirationDate: data.expirationDate || ''
			};
		}

		// Always return something  even if identity info is missing
		return {
			userInfo,
			...documentByType,
			images
		};
	}


	// Execute the cleaner and return the result
	return verifiedDataCleaner(params.verifiedData);
}

