module.exports = a = async ({ params }) => {
  const {
    verifyTransactions = [],
    currentTransaction,
    p1VerifyPolicyId
  } = params || {};

  // Formatter for America/Chicago (handles DST automatically)
  const fmt = new Intl.DateTimeFormat('en-US', {
    year: 'numeric',
    month: 'short',
    day: '2-digit',
    hour: '2-digit',
    minute: '2-digit',
    second: '2-digit',
    hour12: true,
    timeZone: 'America/Chicago',
    timeZoneName: 'short'
  });

  const filtered = verifyTransactions
    .filter(txn =>
      txn.verifyPolicy?.id === p1VerifyPolicyId &&
      txn.id !== currentTransaction
    )
    .sort((a, b) => Date.parse(b.createdAt) - Date.parse(a.createdAt))
    .slice(0, 10)
    .map(txn => ({
      ...txn,
      createdAtDisplay: txn.createdAt ? fmt.format(new Date(txn.createdAt)) : null,
      expiresAtDisplay: txn.expiresAt ? fmt.format(new Date(txn.expiresAt)) : null,
      updatedAtDisplay: txn.updatedAt ? fmt.format(new Date(txn.updatedAt)) : null
    }));

  return { priorVerifyTransactions: filtered };
};

